import React from 'react';

const About = () => {
  return (
    <div className="container mt-5">
        <h1 class="lead text-center">
        <span class="text-primary fw-bold">WeatherWear</span>, your handy weather API.
        </h1>
        <p>
          Welcome to our website! This is the About page where you can learn more about our company or project.
        </p>
        <img src="../ww_logo.png" class="img-fluid center rounded" alt="placeholder" height="30%" width="50%"></img>
        <a class="btn btn-link center" href='/Login'>Sign up & start surveying</a>
    </div>
  );
};

export default About;
